import { Link, useNavigate } from 'react-router-dom';
import { useEffect } from 'react';
import { adminApi, setAuthToken } from '../../api'; // Update the path

const AdminDashboard = () => {
    const navigate = useNavigate();
    const handleOpenDoctorRegistration = () => {
        // Navigate to the DoctorRegistration component
        navigate('/doctor-registration');};
  useEffect(() => {
    // Set JWT token in headers before making any admin API requests
    setAuthToken();

    // Example: Fetch admin data
    adminApi.getData()
      .then(response => {
        console.log('Admin data:', response.data);
      })
      .catch(error => {
        console.error('Error fetching admin data:', error);
      });
      

  }, []); 



  return (
    <div>
      <h1>Admin Dashboard</h1>

      <button onClick={handleOpenDoctorRegistration}>Doctor Registration</button>
    </div>
  );
};

export default AdminDashboard;
